// src/components/AdminReservations.jsx
import { useEffect, useState, useMemo } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/adminreservations.css";

function AdminReservations() {
    const [reservations, setReservations] = useState([]);
    const [loading, setLoading] = useState(true);
    const [errorMsg, setErrorMsg] = useState("");
    const navigate = useNavigate();

    const API = useMemo(
        () => process.env.REACT_APP_API_URL || "http://localhost:8080",
        []
    );

    useEffect(() => {
        let cancelled = false;

        const load = async () => {
            setLoading(true);
            setErrorMsg("");
            try {
                const res = await fetch(`${API}/api/reservations/all`, {
                    credentials: "include",
                });

                if (!res.ok) {
                    const txt = await res.text();
                    throw new Error(txt || `HTTP ${res.status}`);
                }

                const data = await res.json(); // List<ReservationViewDTO>
                if (!cancelled) setReservations(Array.isArray(data) ? data : []);
            } catch (e) {
                if (!cancelled) {
                    console.error("Fehler beim Abrufen der Reservierungen:", e);
                    setErrorMsg(e.message || "Fehler beim Laden.");
                    setReservations([]);
                }
            } finally {
                if (!cancelled) setLoading(false);
            }
        };

        load();
        return () => {
            cancelled = true;
        };
    }, [API]);

    const deleteReservation = async (id) => {
        try {
            const res = await fetch(`${API}/api/reservations/${id}`, {
                method: "DELETE",
                credentials: "include",
            });
            if (!res.ok) throw new Error(`Löschen fehlgeschlagen: ${res.status}`);
            setReservations((prev) => prev.filter((r) => r.id !== id));
        } catch (err) {
            console.error("Fehler beim Löschen der Reservierung:", err);
            setErrorMsg(err.message || "Fehler beim Löschen.");
        }
    };

    const formatDateTimeRange = (startIso, endIso) => {
        if (!startIso || !endIso) return "—";
        const start = new Date(startIso);
        const end = new Date(endIso);

        const dateStr = start.toLocaleDateString("de-DE", {
            day: "2-digit",
            month: "2-digit",
            year: "numeric",
        });
        const t1 = start.toLocaleTimeString("de-DE", { hour: "2-digit", minute: "2-digit" });
        const t2 = end.toLocaleTimeString("de-DE", { hour: "2-digit", minute: "2-digit" });

        return `${dateStr} – ${t1} bis ${t2} Uhr`;
        // Alternatywnie: `${dateStr}, ${t1} – ${t2} Uhr`
    };

    return (
        <main className="admin-resv-page" aria-label="Alle Reservierungen">
            <section className="admin-resv-card">
                <div className="admin-resv-header">
                    <button
                        onClick={() => navigate("/admin")}
                        className="back-button"
                        type="button"
                    >
                        ← Zurück
                    </button>
                    <h1 className="admin-resv-title">Alle Reservierungen</h1>
                </div>

                {loading ? (
                    <div className="skeleton-list" aria-busy="true" aria-live="polite">
                        <div className="skeleton-row" />
                        <div className="skeleton-row" />
                        <div className="skeleton-row" />
                    </div>
                ) : errorMsg ? (
                    <p className="error-text">{errorMsg}</p>
                ) : reservations.length === 0 ? (
                    <p className="empty-state">Keine Reservierungen gefunden.</p>
                ) : (
                    <ul className="admin-reservation-list">
                        {reservations.map((res) => {
                            // ReservationViewDTO z backendu:
                            // { id, userUsername, userFullName, tableNumber, startTime, endTime }
                            const userLabel = res.userFullName || res.userUsername || "–";
                            const tableLabel = res.tableNumber ?? "—";
                            const timeLabel = formatDateTimeRange(res.startTime, res.endTime);

                            return (
                                <li key={res.id} className="res-row">
                                    <div className="reservation-info">
                                        <div>
                                            <strong>Benutzer:</strong> {userLabel}
                                        </div>
                                        <div>
                                            <strong>Tisch:</strong> {tableLabel}
                                        </div>
                                        <div>
                                            <strong>Zeit:</strong> {timeLabel}
                                        </div>
                                    </div>

                                    <button
                                        type="button"
                                        className="delete-btn"
                                        onClick={() => deleteReservation(res.id)}
                                        aria-label="Reservierung löschen"
                                    >
                                        Löschen
                                    </button>
                                </li>
                            );
                        })}
                    </ul>
                )}
            </section>
        </main>
    );
}

export default AdminReservations;
